import Slider from "react-slick";
const Reviews = () => {

    let settings = {
        infinite: false,
        speed: 1000,
        arrows: true,
        slidesToShow: 5,
        slidesToScroll: 4,
    
        responsive: [
          {
            breakpoint: 960,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 2,
            },
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 2,
            },
          },
        ],
      };
    return (
        <div>
            <Slider {...settings}>
            <div className={out} key={current.id}>
              <div className="card">
                
                <div className={cardBody}>
                  <h5 className="card-title">jkdjsd</h5>
                  <small className="card-text text-sm-center text-muted">
                    In your contacts
                  </small>
                  <br />
                  <button className="btn btn-sm follow btn-primary">
                    Follow
                  </button>
                </div>
              </div>
            </div>
                
            </Slider>
        </div>
    )
}

export default Reviews
